import React, { useState } from 'react'
import DatePicker from "react-date-picker";
import { Uploader, Alert,Object,Loader, Icon   } from 'rsuite';

function previewFile(file, callback) {
  const reader = new FileReader();
  reader.onloadend = () => {
    callback(reader.result);
  };
  reader.readAsDataURL(file);
}

const styles = {
  width: 150,
  height: 150
};
const Checkout = () => {
  const [value, onChange] = useState(new Date());
  const [uploading, setUploading] = React.useState(false);
  const [fileInfo, setFileInfo] = React.useState(null);
  return (
<div className="container">
  <div className="row">
    <div className="col-md-6">
    <div style={{marginTop : "100px"}}>
      <div className="row">
  <div className="col-md-6 pt-2">
    <input type="text" className="form-control" placeholder="First name" aria-label="First name" />
  </div>
  <div className="col-md-6 pt-2">
    <input type="text" className="form-control" placeholder="Last name" aria-label="Last name" />
  </div>
</div>
<div className="row">
<div className="col-md-12 pt-2">
    <input type="text" className="form-control" placeholder="Email" aria-label="First name" />
  </div>
  </div>
 
  </div>
  <div className="row">
  <div className="col-md-6 pt-2">
  <DatePicker
  className="form-control"
        onChange={onChange}
        value={value}
      />
  </div>
  <div className="col-md-6 pt-2">
    <input type="text" className="form-control" placeholder="Age" aria-label="Last name" />
  </div>
  </div>
  <div className="row">
  <div className="col-md-6 pt-2">
    <input type="text" className="form-control" placeholder="Contact Number" aria-label="First name" />
  </div>
  <div className="col-md-6  pt-2">
  <select className=" form-control" aria-label=".form-select-lg example">
  <option selected>Gender</option>
  <option value="1">Male</option>
  <option value="2">Female</option>
  <option value="3">Others</option>
</select>
  </div>
</div>
<div className="row">
  <div className="col-md-6 pt-2">
    <input type="text" className="form-control" placeholder="Qualification" aria-label="First name" />
  </div>
  <div className="col-md-6 pt-2">
    <input type="text" className="form-control" placeholder="Additional Course" aria-label="Last name" />
  </div>
</div>
<div className="row">
<div className="col-md-12 pt-2">
<select placeholder="JOBS" className=" form-control" aria-label=".form-select-lg example">
  <option selected>Select Role</option>
  <option value="1">Web Developer</option>
  <option value="2">Mobile Application </option>
  <option value="3">Testing</option>
</select>
  </div>
  </div>
  <div className="row ">
  <div className="col-md-12 pt-2">
    <input type="text" className="form-control" placeholder="Expected Salary" aria-label="Last name" />
  </div>
  </div>
  <Uploader
      fileListVisible={false}
      listType="picture"
      action="//jsonplaceholder.typicode.com/posts/"
      onUpload={file => {
        setUploading(true);
        previewFile(file.blobFile, value => {
          setFileInfo(value);
        });
      }}
      onSuccess={(response: Object, file: FileType) => {
        setUploading(false);
        Alert.success('Uploaded successfully');
        console.log(response);
      }}
      onError={() => {
        setFileInfo(null);
        setUploading(false);
        Alert.error('Upload failed');
      }}
    >
      <button style={styles}>
        {uploading && <Loader backdrop center />}
        {fileInfo ? (
          <img src={fileInfo} width="100%" height="100%" />
        ) : (
          <Icon icon="avatar" size="5x" />
        )}
      </button>
    </Uploader>



    </div>
    <div className="col-md-6">
      Col
      </div></div></div>
  )
}

export default Checkout
